import React from "react";
import { Document} from "react-pdf";
import resume from "../images/Resume.pdf";

function Resume(){
    return(
     <div className="container my-3" style={{width: "300px",
        height: "auto" , 
        textalign: "center", 
        padding: "15px ", 
        border: "3px solid red" }}>
        <iframe src={resume}/>
     </div>
    );
}

export default Resume;
